import React from 'react'

function GridItem(props) {
    
    var count = props.count/10
    var countArray = []

    for(let i=0; i<count; i++){
        countArray[i] = i
    }
    
    const x = (
        (<div className='item'><h1>1</h1></div>)
    )

    return (
        <div>
            {x}
            {x}
            {x}
            {x}
            {x}
            {x}
        </div>
        
        
  )
}

export default GridItem
